import React from "react";

function Home() {
	return (
		<div class="container">
			<div class="align-items-center my-5">
				<div class="col-lg">
					<h1 class="font-weight-light">Welcome!</h1>
					<p>
						Welcome to Chikara Coding's project for SCEHacks 2021 | Code for
						California! This website is built with React.js and Bootstrap, and
						we hope it will . . . . . .<br></br>
						<br></br>
						Use the navigation bar at the top of the screen to jump between our
						pages! We suggest you read the overview first, but you can explore
						if you would like!
					</p>
				</div>
			</div>
		</div>
	);
}

export default Home;
